import React from 'react';


const Rank = ({ entries }) => {
	return (
		<div>
			<div className='white f3'>
				{'Your current image count is ...'}
			</div>
			<div className='white f1'>
				{entries()}
			</div>
		</div>
	)
}

export default Rank;
